column8:
洗車時の水滴除去から、フロントガラスの霜取り・氷取りまでできる、多機能のハンディ・ワイパーです。<br><br>

機能 1：幅28cmのゴム製ワイパーで水滴除去。<br><br>

機能 2：幅10cmの鋭いエッジを持つスクレーパーで霜取り。<br><br>

機能 3：スクレーパー上部に並んだ突起で氷取り。<br><br>

機能 4：付属のピンでノズル掃除。
<br><br>
製品の詳細
<br><br>
■ 製造国・メーカー：ドイツ・HR リヒター社製<br>
■ ボディーカラー：ブラック<br>
■ ウォッシャーノズル掃除用ピン付属。<br>
■ 製品サイズ（外寸）：W285 x H80 x D15mm<br><br><h2>HR RICHTER AUTO-COMFORT MADE IN GERMANY</h2>
<font size="2" color="#464646">
iPhone・スマートフォン・カメラの車載に最適。リヒター・マウントシステムは、ご使用の機器に合わせ、取り付け場所に応じて、ホルダーとマウントを自由に組み合わせてご利用いただけます。</font>
<br><br>
<img width="825" src="http://image.rakuten.co.jp/richter/cabinet/richter/richter_top01.jpg"><br><br>
